documentation/annotations.html.body:
Annotation Mappings


Why Annotations?

One of the downsides of using Dozer for the long time was Xml. Since
Dozer started during Xml-hype years more than five years ago that was
pretty obvious choice back then. After that Java 5 brought us
annotations and new industry accepted style of configuring behaviour are
Domain-Specific Languages. DSL-like support is provided in form of
mapping API, but since version 5.3.2 Dozer starts providing annotations
support as well.


The obvious reasons to use annotations is to avoid duplicating field and
method names in your mapping code. The annotation can be put onto the
mapped property itself thus reducing the amount of code. However there
are cases when annotations should be avoided or even impossible to use.
Some of them are the following:




You are mapping classes, which are not under your control, but
provided in libraries;


The mappings are quite complex and require many configurations;




In the first case you could be mapping JAXB generated entities or
third-party DTOs and have no possibility to put annotations. In the
second case there is a choice of putting lots of multi-line annotations
or isolating the mapping code with certain duplication of entity names.
Overannotated beans could be problematic to read and understand.



Usage

WARNING: Annotation support in Dozer is experimental and does not
cover complex use cases yet. However it may be useful to implement that
simplest mappings you have had to do in Xml or API before.


The idea is very simple. You put @Mapping annotation either on getter of
field directly. If Dozer finds that it adds a bi-directional mapping. It
means that putting annotation once will create mappings for both
conversion types. Type conversions (e.g. String-Long) will be chosen
automatically. Global custom converters are resolved as well.
Annotations work only if a conversion is subject to wildcard rule
(active by default). The following example demonstrates annotations in
action.



public class SourceBean {

    private Long id;

    private String name;

    @Mapping("binaryData")
    private String data;

    @Mapping("pk")
    public Long getId() {
        return this.id;
    }

    public String getName() {
        return this.name;
    }
}




public class TargetBean {

    private String pk;

    private String name;

    private String binaryData;

    public void setPk(String pk) {
        this.pk = pk;
    }

    public void setName(String name) {
        this.name = name;
    }
}



Mapping the given beans with Dozer will result in all three fields being
mapped. Property "name" will be mapped by naming convention. Property
"id" will be transformed to "pk". Field "data" will be moved to
"binaryData". Do not worry about private modifier; it will be handled
automatically.


Currently Dozer offers only one annotation, but the next ones will be
added in following releases. As for now you can mix and match all
flavours of mapping types to achieve the desired effect: Xml, API and
Annotations.

documentation/apimappings.html.body:
API Mappings


XML Mapping Flaws

XML-based approach is stable and is used in many production projects.
However, it imposes several limitations.




First, and most important, is that it can not be dynamically
generated. All XML mappings should be present on Dozer start-up and can
not be modified afterwards. There are tricky ways, when you can generate
and put mappings to the file system by your own templating engine, but
this approach is not supported by Dozer itself. By generating custom
mappings you are able to automate repetitive chunks of low-level Dozer
language.


Second problem is that you are forced to duplicate all of your Bean
class names in Xml mappings. This leads to lots of typing and copy-paste
programming. This can be partly compensated by use of Expression
Language inside Xml, but it is not solving all of the problems.


Refactoring support is limited as IDE should keep track of class names
in Xml files and change them when you rename or move the referenced
class. Auto-completion support is also not available in all IDEs.





API Mappings

API mappings are intended to solve all of the mentioned problems. To
preserve backwards compatibility API mappings can be combined with
existing Xml mappings. In fact some parts of the configuration (e.g.
global configuration block) are only possible to express in Xml format.


To get a feeling of what are these mappings take a look at the following
code example.



import com.github.dozermapper.core.classmap.RelationshipType;
import com.github.dozermapper.core.loader.api.BeanMappingBuilder;
import com.github.dozermapper.core.loader.api.FieldsMappingOptions;
import com.github.dozermapper.core.loader.api.TypeMappingOptions;

import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.collectionStrategy;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.copyByReference;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.customConverter;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.customConverterId;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.hintA;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.hintB;
import static com.github.dozermapper.core.loader.api.FieldsMappingOptions.useMapId;
import static com.github.dozermapper.core.loader.api.TypeMappingOptions.mapId;
import static com.github.dozermapper.core.loader.api.TypeMappingOptions.mapNull;

public class MyClass {

    public void create() {
        BeanMappingBuilder builder = new BeanMappingBuilder() {
            protected void configure() {
                mapping(Bean.class, Bean.class,
                        TypeMappingOptions.oneWay(),
                        mapId("A"),
                        mapNull(true)
                )
                    .exclude("excluded")
                    .fields("src", "dest",
                            copyByReference(),
                            collectionStrategy(true, RelationshipType.NON_CUMULATIVE),
                            hintA(String.class),
                            hintB(Integer.class),
                            FieldsMappingOptions.oneWay(),
                            useMapId("A"),
                            customConverterId("id")
                    )
                    .fields("src", "dest",
                            customConverter("com.github.dozermapper.core.CustomConverter")
                    );
            }
        };
    }
}



Constructed builder object should be then passed to DozerBeanMapperBuilder.
It is possible to add multiple Builder classes.



Mapper mapper = DozerBeanMapperBuilder.create()
        .withMappingBuilder(builder)
        .build();

documentation/apiConfiguration.html.body:
Configuration via API


If you are using the MapperBuilder to
define your mappings, you can declare mapping, class, and field
configuration settings programmatically:



Mapper mapper = DozerBeanMapperBuilder.create()
                .withMappingBuilder(new BeanMappingBuilder() {
                    @Override
                    protected void configure() {
                        mapping(type(A.class).mapEmptyString(true),
                                type(B.class),
                                TypeMappingOptions.wildcardCaseInsensitive(true)
                        ).fields(
                                field("fieldOfA").getMethod("getTheField"),
                                field("fieldOfB"),
                                FieldsMappingOptions.oneWay()
                        );
                    }
                })
                .build();



Global configuration is currently not supported by the API.


Please see Configuration via XML
for a list of the available configuration settings.

